const explicacoes = {
  "abrir-lembrete-no-popup": '<h1 id="funcionalidade-abrir-lembrete-no-popup">Funcionalidade: Abrir Lembrete No Popup</h1>\n<p>Descri\u00e7\u00e3o da funcionalidade: descreva a funcionalidade detalhando o que ela faz, sua utilidade, etc.</p>\n<p>Configura\u00e7\u00f5es: chave tipo switch localizada na guia Recursos experimentais da p\u00e1gina de op\u00e7\u00f5es. (caso voc\u00ea modifique a forma de configura\u00e7\u00e3o, voc\u00ea deve alterar o texto aqui tamb\u00e9m)</p>\n<p>Como testar: descreva como testar a funcionalidade com o m\u00e1ximo de detalhes poss\u00edveis.</p>\n',
  "abrir-link-menu-no-appup": '<h1 id="funcionalidade-abrir-link-menu-no-appup">Funcionalidade: Abrir Link Menu No Appup</h1>\n<p>Descri\u00e7\u00e3o da funcionalidade: Cria um bot\u00e3o ao lado da barra do menu lateral, para abrir o link no AppPopup</p>\n',
  "adicionar-etiquetas-autos": '<h1 id="funcionalidade-adicionar-etiquetas-autos">Funcionalidade: Adicionar Etiquetas Autos</h1>\n<h2 id="descri\u00e7\u00e3o-da-funcionalidade">Descri\u00e7\u00e3o da funcionalidade</h2>\n<p>Voc\u00ea pode adicionar etiquetas ao processo enquanto est\u00e1 na tela de Autos Digitais.</p>\n<h2 id="configura\u00e7\u00f5es">Configura\u00e7\u00f5es</h2>\n<p>A funcionalidade pode ser ativada atrav\u00e9s de uma chave tipo switch localizada na guia <strong>Recursos experimentais</strong> da p\u00e1gina de op\u00e7\u00f5es. Ative a chave <strong>Adicionar Etiquetas Autos</strong> para utilizar esta funcionalidade.</p>\n<h2 id="como-testar">Como testar</h2>\n<ol>\n<li>Localize o \u00edcone de etiquetas na barra de t\u00edtulo, no lado direito.</li>\n<li>Clique neste \u00edcone para ver todas as etiquetas que j\u00e1 est\u00e3o adicionadas ao processo.</li>\n<li>Um \u00edcone verde com um sinal de &quot;+&quot; tamb\u00e9m estar\u00e1 presente. Clique neste \u00edcone para ver todas as etiquetas dispon\u00edveis na sua lota\u00e7\u00e3o.</li>\n<li>Para adicionar uma etiqueta ao projeto, basta clicar sobre o nome da etiqueta desejada.</li>\n</ol>\n',
  "ajg": '<h1 id="funcionalidade-integra\u00e7\u00e3o-ajg">Funcionalidade: Integra\u00e7\u00e3o AJG</h1>\n<h2 id="descri\u00e7\u00e3o-da-funcionalidade">Descri\u00e7\u00e3o da funcionalidade</h2>\n<p>Esta funcionalidade visa facilitar a expedi\u00e7\u00e3o e consulta de Requisi\u00e7\u00e3o de Pagamento no sistema AJG.</p>\n<h2 id="configura\u00e7\u00f5es">Configura\u00e7\u00f5es</h2>\n<p>A funcionalidade pode ser ativada atrav\u00e9s de uma chave tipo switch localizada na guia <strong>Recursos experimentais</strong> da p\u00e1gina de op\u00e7\u00f5es.</p>\n<h2 id="como-testar">Como testar</h2>\n<ol>\n<li>Abra um processo em modo Autos Digitais.</li>\n<li>Visualize o \u00edcone ao lado do n\u00famero do processo.</li>\n<li>Clique neste \u00edcone para abrir uma nova janela com o sistema AJG.</li>\n<li>No primeiro acesso ao sistema AJG, ser\u00e1 necess\u00e1rio fazer login manualmente.</li>\n<li>Na nova janela do sistema AJG, visualize os dados do processo e clique no bot\u00e3o para iniciar a expedi\u00e7\u00e3o da Requisi\u00e7\u00e3o de Pagamento.</li>\n</ol>\n',
  "automacao-processos": '<h1 id="01---funcionalidade-lista-processos-etiquetar">01 - Funcionalidade: Lista Processos Etiquetar</h1>\n<h2 id="descri\u00e7\u00e3o-da-funcionalidade">Descri\u00e7\u00e3o da funcionalidade</h2>\n<p>Atrav\u00e9s de uma lista de processos que pode ser copiada ou vir de um arquivo CSV ou TXT, a automa\u00e7\u00e3o ir\u00e1 vincular ou desvincular as etiquetas aos processos.</p>\n<h2 id="configura\u00e7\u00f5es">Configura\u00e7\u00f5es</h2>\n<p>Chave tipo switch localizada na guia <strong>Automa\u00e7\u00e3o</strong> da p\u00e1gina de op\u00e7\u00f5es. Ative a op\u00e7\u00e3o <strong>Automa\u00e7\u00e3o nos processos</strong>.</p>\n<h2 id="como-testar">Como testar</h2>\n<ol>\n<li>No painel de tarefas, aparecer\u00e1 um \u00edcone do Pje+R no lado esquerdo da p\u00e1gina.</li>\n<li>Clique e segure o \u00edcone, arrastando-o at\u00e9 um local em que a tela fique vis\u00edvel.</li>\n<li>No campo, voc\u00ea poder\u00e1 digitar os n\u00fameros dos processos, copiar de outro local ou abrir um arquivo que contenha os n\u00fameros dos processos.</li>\n<li>Clique no bot\u00e3o <strong>Avan\u00e7ar</strong>.</li>\n<li>Aparecer\u00e1 uma pergunta se voc\u00ea deseja adicionar alguma etiqueta. Escolha a op\u00e7\u00e3o desejada e clique novamente em <strong>Avan\u00e7ar</strong>. Se a resposta for sim, aparecer\u00e1 uma lista de etiquetas. Escolha as etiquetas que deseja adicionar e clique novamente em <strong>Avan\u00e7ar</strong>.</li>\n<li>Aparecer\u00e1 a pergunta se deseja retirar alguma etiqueta. Escolha a op\u00e7\u00e3o desejada e clique novamente em <strong>Avan\u00e7ar</strong>.</li>\n<li>Por \u00faltimo, aparecer\u00e1 um resumo do que ser\u00e1 feito e o bot\u00e3o <strong>Iniciar Automa\u00e7\u00e3o</strong>.</li>\n<li>Depois de clicar no bot\u00e3o <strong>Iniciar Automa\u00e7\u00e3o</strong>, ser\u00e1 gerado um relat\u00f3rio de todos os processos alterados.</li>\n</ol>\n<h1 id="02---funcionalidade-lista-processos-etiquetar-e-movimentar">02 - Funcionalidade: Lista Processos Etiquetar e Movimentar</h1>\n<h2 id="descri\u00e7\u00e3o-da-funcionalidade-1">Descri\u00e7\u00e3o da funcionalidade</h2>\n<p>Estando dentro de uma tarefa, voc\u00ea poder\u00e1 usar a automa\u00e7\u00e3o para vincular, desvincular e movimentar os processos da tarefa.</p>\n<h2 id="configura\u00e7\u00f5es-1">Configura\u00e7\u00f5es</h2>\n<p>Chave tipo switch localizada na guia <strong>Recursos experimentais</strong> da p\u00e1gina de op\u00e7\u00f5es. Ative a op\u00e7\u00e3o <strong>Automa\u00e7\u00e3o nos processos</strong>.</p>\n<h2 id="como-testar-1">Como testar</h2>\n<ol>\n<li>Dentro da tarefa, localize o \u00edcone do PJe+R no lado esquerdo da tela.</li>\n<li>Clique neste \u00edcone para ver a tela de personaliza\u00e7\u00e3o da automa\u00e7\u00e3o.</li>\n<li>Responda \u00e0s perguntas e clique no bot\u00e3o <strong>Avan\u00e7ar</strong> at\u00e9 aparecer um resumo do que ser\u00e1 feito.</li>\n<li>Depois de clicar no bot\u00e3o <strong>Iniciar Automa\u00e7\u00e3o</strong>, ser\u00e1 gerado um relat\u00f3rio de todos os processos alterados.</li>\n</ol>\n<h2 id="aten\u00e7\u00e3o">Aten\u00e7\u00e3o</h2>\n<p>A automa\u00e7\u00e3o ir\u00e1 processar toda a tarefa, mesmo se voc\u00ea estiver filtrado por etiqueta e na tela estiverem aparecendo apenas os processos daquela etiqueta. A automa\u00e7\u00e3o considerar\u00e1 o total de processos daquela tarefa espec\u00edfica.</p>\n',
  "contador-tempo-mandado": '<h1 id="funcionalidade-contador-tempo-mandado">Funcionalidade: Contador Tempo Mandado</h1>\n<h2 id="descri\u00e7\u00e3o-de-alto-n\u00edvel">Descri\u00e7\u00e3o de alto n\u00edvel</h2>\n<p>O <strong>Contador Tempo Mandado</strong> \u00e9 uma funcionalidade que calcula e exibe o tempo decorrido desde a data de um mandado at\u00e9 o momento atual, em um formato simples e visualmente destacado. Essa funcionalidade \u00e9 \u00fatil para monitorar prazos e acompanhar o andamento de mandados diretamente na interface do sistema.</p>\n<h2 id="configura\u00e7\u00f5es">Configura\u00e7\u00f5es</h2>\n<p>A ativa\u00e7\u00e3o da funcionalidade \u00e9 feita por meio de uma chave do tipo <strong>switch</strong>, localizada na guia <strong>Recursos experimentais</strong> da p\u00e1gina de configura\u00e7\u00f5es. O usu\u00e1rio pode habilitar ou desabilitar o recurso conforme necess\u00e1rio.</p>\n<h2 id="como-testar">Como testar</h2>\n<ol>\n<li>Ative a funcionalidade na guia <strong>Recursos experimentais</strong>.</li>\n<li>Acesse uma tela que exiba mandados com data e hora.</li>\n<li>Verifique se o tempo decorrido aparece abaixo da data/hora de cada mandado, no formato &quot;<strong>X dias e Y horas</strong>&quot;, com estilo destacado.</li>\n<li>Desative a funcionalidade e confirme que os dados inseridos desaparecem corretamente.</li>\n</ol>\n<h2 id="observa\u00e7\u00f5es">Observa\u00e7\u00f5es</h2>\n<p>Certifique-se de que as datas dos mandados est\u00e3o no formato esperado (<code>dd/mm/yyyy hh:mm</code>) para o correto funcionamento da funcionalidade.</p>\n',
  "contar-selecao-processos": '<h1 id="funcionalidade-contar-processos-selecionados">Funcionalidade: Contar Processos Selecionados</h1>\n<h2 id="descri\u00e7\u00e3o-da-funcionalidade">Descri\u00e7\u00e3o da funcionalidade</h2>\n<p>Ao selecionar processos, no local onde aparece o n\u00famero total de processos na tarefa, surgir\u00e1 um novo n\u00famero \u00e0 frente, indicando a quantidade de processos que voc\u00ea selecionou.</p>\n<h2 id="configura\u00e7\u00f5es">Configura\u00e7\u00f5es</h2>\n<p>A funcionalidade pode ser ativada atrav\u00e9s de uma chave tipo switch localizada na guia <strong>Lista de Processos</strong> da p\u00e1gina de op\u00e7\u00f5es.</p>\n<h2 id="como-testar">Como testar</h2>\n<ol>\n<li>Ative a funcionalidade na p\u00e1gina de op\u00e7\u00f5es.</li>\n<li>Selecione os processos desejados na lista.</li>\n<li>O contador exibir\u00e1 algo como: 15/194, onde o primeiro n\u00famero representa os processos selecionados e o segundo, o total de processos na tarefa.</li>\n</ol>\n',
  "copiar-dados-polo": '<h1 id="funcionalidade-copiar-dados-polo">Funcionalidade: Copiar Dados Polo</h1>\n<h2 id="descri\u00e7\u00e3o-da-funcionalidade">Descri\u00e7\u00e3o da funcionalidade</h2>\n<p>Esta funcionalidade permite copiar o CPF da parte ou do advogado para a \u00e1rea de transfer\u00eancia ao clicar com o mouse.</p>\n<h2 id="configura\u00e7\u00f5es">Configura\u00e7\u00f5es</h2>\n<p>Para ativar ou desativar a funcionalidade, abra a p\u00e1gina de op\u00e7\u00f5es da extens\u00e3o, localize a aba <strong>Recursos Experimentais</strong> e clique na <strong>checkbox</strong> em frente \u00e0 op\u00e7\u00e3o <strong>Copiar Dados Polo</strong>.</p>\n<h2 id="como-testar">Como testar</h2>\n<ol>\n<li>Na p\u00e1gina <strong>Autos Digitais</strong>, onde ficam os detalhes do processo, no final do nome da parte ou do advogado, aparecer\u00e1 um \u00edcone laranja.</li>\n<li>Clique sobre o \u00edcone laranja e o CPF ser\u00e1 copiado para a \u00e1rea de transfer\u00eancia.</li>\n</ol>\n',
  "estender-acessibilidade-pcd-visual": '<h1 id="manual-da-funcionalidade-de-acessibilidade">Manual da Funcionalidade de Acessibilidade</h1>\n<h2 id="vis\u00e3o-geral">Vis\u00e3o Geral</h2>\n<p>A funcionalidade de Acessibilidade Inteligente foi criada para melhorar a experi\u00eancia de navega\u00e7\u00e3o de pessoas que utilizam leitores de tela ou teclado para interagir com p\u00e1ginas web. Ela identifica os elementos HTML da p\u00e1gina, adiciona atributos de acessibilidade relevantes, como <code>aria-label</code>, e organiza a tabula\u00e7\u00e3o para garantir que os usu\u00e1rios possam navegar facilmente.</p>\n<hr>\n<h2 id="o-que-esta-funcionalidade-faz">O que Esta Funcionalidade Faz?</h2>\n<ol>\n<li><p><strong>Adiciona Descri\u00e7\u00f5es Acess\u00edveis:</strong></p>\n<ul>\n<li>Os elementos que possuem um <code>title</code>, texto vis\u00edvel ou atributo <code>alt</code> recebem automaticamente um <code>aria-label</code> com esse conte\u00fado, para que leitores de tela possam interpretar.</li>\n</ul>\n</li>\n<li><p><strong>Organiza a Tabula\u00e7\u00e3o:</strong></p>\n<ul>\n<li>Adiciona o atributo <code>tabindex=&quot;0&quot;</code> aos elementos interativos (bot\u00f5es, links, campos de formul\u00e1rio) para inclu\u00ed-los no ciclo de navega\u00e7\u00e3o do teclado.</li>\n<li>Elementos n\u00e3o interativos, mas com informa\u00e7\u00f5es importantes, tamb\u00e9m recebem tabula\u00e7\u00e3o.</li>\n</ul>\n</li>\n<li><p><strong>Ignora Elementos Irrelevantes:</strong></p>\n<ul>\n<li>Elementos invis\u00edveis ou que j\u00e1 possuem <code>aria-label</code> n\u00e3o s\u00e3o alterados, garantindo que a funcionalidade n\u00e3o interfira em conte\u00fados j\u00e1 acess\u00edveis.</li>\n</ul>\n</li>\n</ol>\n<hr>\n<h2 id="como-funciona">Como Funciona?</h2>\n<p>A funcionalidade percorre todos os elementos HTML da p\u00e1gina e segue estas etapas:</p>\n<ol>\n<li>Captura os elementos com <code>document.querySelectorAll(&quot;*&quot;)</code>.</li>\n<li>Verifica se o elemento:<ul>\n<li>J\u00e1 possui <code>aria-label</code>.</li>\n<li>Est\u00e1 vis\u00edvel na p\u00e1gina.</li>\n</ul>\n</li>\n<li>Identifica o conte\u00fado do elemento usando:<ul>\n<li>O atributo <code>title</code>.</li>\n<li>O atributo <code>tooltip</code>.</li>\n<li>O atributo <code>alt</code> (para imagens).</li>\n</ul>\n</li>\n<li>Adiciona um <code>aria-label</code> ao elemento com o conte\u00fado identificado.</li>\n<li>Configura a tabula\u00e7\u00e3o com <code>tabindex=&quot;0&quot;</code> para garantir que o elemento seja naveg\u00e1vel pelo teclado.</li>\n</ol>\n<hr>\n<h2 id="benef\u00edcios-para-os-usu\u00e1rios">Benef\u00edcios para os Usu\u00e1rios</h2>\n<ul>\n<li><strong>Leitores de Tela:</strong> Agora os bot\u00f5es, links e outros elementos interativos possuem descri\u00e7\u00f5es claras e leg\u00edveis.</li>\n<li><strong>Navega\u00e7\u00e3o por Teclado:</strong> A tabula\u00e7\u00e3o torna a p\u00e1gina mais fluida e acess\u00edvel para quem utiliza teclado como dispositivo principal de navega\u00e7\u00e3o.</li>\n<li><strong>Inclus\u00e3o:</strong> Pessoas com defici\u00eancia visual ou motora podem interagir com a p\u00e1gina de maneira mais eficiente e intuitiva.</li>\n</ul>\n<hr>\n<h2 id="limita\u00e7\u00f5es">Limita\u00e7\u00f5es</h2>\n<ul>\n<li>Elementos din\u00e2micos adicionados ap\u00f3s a execu\u00e7\u00e3o desta funcionalidade podem n\u00e3o ser automaticamente acess\u00edveis.</li>\n<li>\u00c9 necess\u00e1rio testar a funcionalidade em p\u00e1ginas complexas para garantir que ela n\u00e3o introduza conflitos com scripts ou estilos existentes.</li>\n</ul>\n<hr>\n<h2 id="como-ativar-esta-funcionalidade">Como Ativar Esta Funcionalidade?</h2>\n<ul>\n<li><strong>Localiza\u00e7\u00e3o:</strong> A chave de tipo switch est\u00e1 localizada na guia &quot;Recursos experimentais&quot; da p\u00e1gina de op\u00e7\u00f5es.</li>\n<li><strong>Nome da Chave:</strong> Estender Acessibilidade PCD Visual</li>\n</ul>\n<hr>\n<h2 id="exemplos">Exemplos</h2>\n<h3 id="antes-da-funcionalidade">Antes da Funcionalidade:</h3>\n<pre><code class="language-html">&lt;button id=&quot;btnSubmit&quot;&gt;Enviar&lt;/button&gt;\n</code></pre>\n<h3 id="depois-da-funcionalidade">Depois da Funcionalidade:</h3>\n<pre><code class="language-html">&lt;button id=&quot;btnSubmit&quot; aria-label=&quot;Enviar&quot; tabindex=&quot;0&quot;&gt;Enviar&lt;/button&gt;\n</code></pre>\n<hr>\n<h2 id="recomenda\u00e7\u00f5es-de-uso">Recomenda\u00e7\u00f5es de Uso</h2>\n<ul>\n<li>Utilize esta funcionalidade em p\u00e1ginas que n\u00e3o foram projetadas com acessibilidade em mente.</li>\n<li>Teste a p\u00e1gina com leitores de tela populares, como NVDA ou JAWS, para validar as melhorias.</li>\n<li>Combine com outras boas pr\u00e1ticas de acessibilidade, como contraste de cores e legendas em v\u00eddeos.</li>\n</ul>\n<hr>\n<h2 id="suporte">Suporte</h2>\n<p>Se voc\u00ea encontrar problemas ou tiver d\u00favidas sobre esta funcionalidade, entre em contato com nossa equipe de suporte t\u00e9cnico.</p>\n',
  "etiqueta-favorita-minhas-tarefas": '<h1 id="funcionalidade-etiqueta-favorita-minhas-tarefas">Funcionalidade: Etiqueta Favorita Minhas Tarefas</h1>\n<h2 id="descri\u00e7\u00e3o-da-funcionalidade">Descri\u00e7\u00e3o da funcionalidade</h2>\n<p>Esta funcionalidade adiciona no painel do usu\u00e1rio, na coluna <strong>Minhas Tarefas</strong>, o nome da etiqueta favorita abaixo do nome da tarefa.</p>\n<h2 id="configura\u00e7\u00f5es">Configura\u00e7\u00f5es</h2>\n<p>A funcionalidade pode ser ativada atrav\u00e9s de uma chave tipo switch localizada na guia <strong>Etiquetas</strong> da p\u00e1gina de op\u00e7\u00f5es.</p>\n<h2 id="como-testar">Como testar</h2>\n<ol>\n<li>Ative o recurso <strong>Minhas Tarefas - Mostra Etiquetas</strong> na p\u00e1gina de op\u00e7\u00f5es, na guia <strong>Etiquetas</strong>.</li>\n<li>Acesse o painel do usu\u00e1rio.</li>\n<li>Visualize as etiquetas favoritadas abaixo do nome das tarefas na coluna <strong>Minhas Tarefas</strong>.</li>\n</ol>\n',
  "etiquetas-coloridas": '<h1 id="funcionalidade-etiquetas-coloridas">Funcionalidade: Etiquetas Coloridas</h1>\n<h2 id="descri\u00e7\u00e3o-da-funcionalidade">Descri\u00e7\u00e3o da funcionalidade</h2>\n<p>Esta funcionalidade permite que voc\u00ea escolha a cor de cada etiqueta pelo texto que a etiqueta cont\u00e9m.</p>\n<h2 id="configura\u00e7\u00f5es">Configura\u00e7\u00f5es</h2>\n<p>A funcionalidade pode ser ativada atrav\u00e9s de uma chave tipo switch localizada na guia <strong>Etiquetas</strong> da p\u00e1gina de op\u00e7\u00f5es.</p>\n<h2 id="como-testar">Como testar</h2>\n<ol>\n<li>Acesse uma tarefa qualquer e v\u00e1 para a guia <strong>Etiquetas</strong>.</li>\n<li>Ao lado de cada etiqueta, deve aparecer um \u00edcone. Clique nesse \u00edcone para mostrar uma janela com as op\u00e7\u00f5es de cores.</li>\n<li>Alternativamente, ao clicar no \u00edcone de cria\u00e7\u00e3o de etiquetas, deve aparecer um \u00edcone pr\u00f3ximo do nome da etiqueta que, ao ser clicado, mostrar\u00e1 uma janela com as op\u00e7\u00f5es de cores.</li>\n</ol>\n',
  "exibir-id-origem": '<h1 id="funcionalidade-exibir-id-origem">Funcionalidade: Exibir Id Origem</h1>\n<p><strong>Descri\u00e7\u00e3o da funcionalidade</strong>: Exibe o &quot;ID&quot; dos documentos juntados em outras inst\u00e2ncias do PJE na timeline processual (ao lado dos respectivos documentos) e ao lado do t\u00edtulo do documento aberto.</p>\n<p><strong>Contextualiza\u00e7\u00e3o</strong>: Quando um processo \u00e9 transferido entre inst\u00e2ncias (ex: remetido para o Tribunal em grau de recurso, ou devolvido ao ju\u00edzo de origem) os &quot;IDs&quot; dos documentos s\u00e3o &quot;alterados&quot;, de modo que o mesmo documento vai ter diferentes &quot;IDs&quot; a depender de qual inst\u00e2ncia ele esteja sendo visualizado (PJE de 1\u00ba ou 2\u00ba grau). Contudo, nos autos digitais, o PJE s\u00f3 exibe o &quot;ID&quot; correspondente \u00e0 inst\u00e2ncia em que o documento est\u00e1 aberto, impedindo a f\u00e1cil identifica\u00e7\u00e3o/localiza\u00e7\u00e3o de documentos indicados em atos processuais praticados em outra inst\u00e2ncia.</p>\n<p><strong>Como utilizar</strong>: ative a fun\u00e7\u00e3o pelo switch localizado na guia Recursos experimentais da p\u00e1gina de op\u00e7\u00f5es.</p>\n',
  "filtros-tarefas": '<h1 id="funcionalidade-filtros-setores">Funcionalidade: Filtros Setores</h1>\n<h2 id="descri\u00e7\u00e3o-da-funcionalidade">Descri\u00e7\u00e3o da funcionalidade</h2>\n<p>Esta funcionalidade permite que voc\u00ea crie filtros acima da coluna &quot;Tarefas&quot; no painel do usu\u00e1rio. Voc\u00ea tamb\u00e9m pode exportar esses filtros na p\u00e1gina de op\u00e7\u00f5es para que sua equipe funcione em sintonia.</p>\n<h2 id="configura\u00e7\u00f5es">Configura\u00e7\u00f5es</h2>\n<p>Na p\u00e1gina de op\u00e7\u00f5es, voc\u00ea encontrar\u00e1 no menu lateral esquerdo a aba <strong>Filtros de tarefas</strong>. Clique nela.</p>\n<p>A configura\u00e7\u00e3o \u00e9 dividida em tr\u00eas partes:</p>\n<ol>\n<li>Perfil ativo</li>\n<li>Setores</li>\n<li>Tarefas</li>\n</ol>\n<h3 id="1-perfil-ativo">1. Perfil ativo</h3>\n<p>Ao selecionar um perfil, os setores contidos nele estar\u00e3o dispon\u00edveis no painel do usu\u00e1rio.\nVoc\u00ea n\u00e3o pode criar novos perfis.</p>\n<h3 id="2-setores">2. Setores</h3>\n<p>O nome do setor que voc\u00ea deseja selecionar para as tarefas. Ex.: &quot;Recebimento&quot;.</p>\n<ul>\n<li>Voc\u00ea pode adicionar novos setores simplesmente escrevendo o nome desejado e pressionando a tecla Enter ou clicando no bot\u00e3o &quot;Adicionar&quot; ao lado direito da caixa de texto.</li>\n<li>Ap\u00f3s criar o setor, clique nele antes de adicionar o nome de uma tarefa a esse setor.</li>\n</ul>\n<h4 id="21-importando-filtros-de-setores">2.1 Importando filtros de setores</h4>\n<p>Voc\u00ea pode importar um setor encaminhado por um colega ou que voc\u00ea exportou como forma de backup. Para isso, clique no bot\u00e3o <strong>Importar setor</strong> ao lado direito do bot\u00e3o <strong>Adicionar</strong> e da caixa de texto, e selecione o arquivo .txt que voc\u00ea exportou ou recebeu.</p>\n<h4 id="22-exportando-filtros-de-setores">2.2 Exportando filtros de setores</h4>\n<p>Para exportar um setor, coloque o mouse sobre ele e aparecer\u00e3o alguns bot\u00f5es de edi\u00e7\u00e3o, incluindo o bot\u00e3o <strong>Exportar setor</strong>. Ao clicar nele, ser\u00e1 feito o download de um arquivo .txt na sua pasta de downloads, que pode ser encaminhado a um colega ou usado como backup.</p>\n<h3 id="3-tarefas">3. Tarefas</h3>\n<p>As tarefas que devem ser mostradas quando voc\u00ea clicar no setor.</p>\n<ul>\n<li>Voc\u00ea pode adicionar uma tarefa simplesmente digitando o nome completo, como: &quot;[JEF] Triagem inicial&quot;, ou parte do nome, como: &quot;Triagem&quot; ou &quot;tri&quot;.</li>\n</ul>\n<h2 id="como-testar">Como testar</h2>\n<p>Acesse o painel do usu\u00e1rio e visualize os filtros aparecendo na coluna &quot;Tarefas&quot;.</p>\n',
  "gerar-sinopse-relatoria": '<h1 id="funcionalidade-sinopse-relatoria">Funcionalidade: Sinopse Relatoria</h1>\n<p>Descri\u00e7\u00e3o da funcionalidade:</p>\n<p>Ao clicar no bot\u00e3o GERAR RELAT\u00d3RIO SINOPSE as ementas dos processos pautados para julgamento s\u00e3o copiadas, ordenadas por tipo de voto e assunto e disponibilizadas em um arquivo word \u00fanico.</p>\n<p>Configura\u00e7\u00f5es:</p>\n<p>Para ativar ou desativar a funcionalidade abra a pagina de op\u00e7\u00f5es de extens\u00e3o localize a aba Recursos Experimentais e clique no CHECBOX em frente a palavra Sinopse Relatoria.</p>\n<p>Pr\u00e9-requisitos:</p>\n<ol>\n<li>O voto e a ementa devem estar liberados.</li>\n<li>Na aba ementa deve ser utilizado o modelo de ementa padr\u00e3o que pode ser copiado de:\na. Configura\u00e7\u00e3o - Documentos - Modelo - Modelo - Copiar Modelo\nb. Localiza\u00e7\u00e3o origem do documento:\ni. Tribunal Regional Federal da 1\u00aa Regi\u00e3o\nii. Turmas Recursais e Regionais da 1\u00aa Regi\u00e3o\niii. Turmas Recursais SJBA\niv. 4\u00aa Turma Recursal\nv. Secretaria da 4\u00aa Turma Recursal da SJBA\nvi. 2\u00aa Relatoria da 4\u00aa Turma Recursal da SJBA\nc. Copiar o modelo: Ementa Modelo Sinopse Relatoria e fazer os ajustes necess\u00e1rios</li>\n<li>Todo o conte\u00fado da s\u00famula de julgamento deve estar contido no corpo da ementa modelo</li>\n</ol>\n<p>Como testar:</p>\n<p>Para testar selecione uma data de pauta na Rela\u00e7\u00e3o de Julgamento com o perfil Assessoria de Gabinete de Turma Recursal/Assessor de Gabinete de Turma e clique no bot\u00e3o GERAR RELAT\u00d3RIO SINOPSE.</p>\n',
  "gerenciador-etiquetas": '<h1 id="funcionalidade-gerenciador-de-etiquetas">Funcionalidade: Gerenciador de Etiquetas</h1>\n<h2 id="descri\u00e7\u00e3o-da-funcionalidade">Descri\u00e7\u00e3o da funcionalidade</h2>\n<ol>\n<li>O primeiro bot\u00e3o encontra todas as etiquetas vazias, ou seja, as etiquetas que n\u00e3o t\u00eam nenhum processo vinculado.</li>\n<li>O segundo bot\u00e3o procura todas as etiquetas com nomes parecidos para que o usu\u00e1rio decida se deseja vincul\u00e1-las.</li>\n<li>Ao pesquisar por uma etiqueta, o usu\u00e1rio tem a op\u00e7\u00e3o de baixar todos os processos que contenham a etiqueta pesquisada.</li>\n</ol>\n<h2 id="configura\u00e7\u00f5es">Configura\u00e7\u00f5es</h2>\n<p>A funcionalidade pode ser ativada atrav\u00e9s de uma chave tipo switch localizada na guia <strong>Etiquetas</strong> da p\u00e1gina de op\u00e7\u00f5es, com o nome <strong>Gerenciador de Etiquetas</strong>.</p>\n<h2 id="como-testar">Como testar</h2>\n<ol>\n<li><p><strong>Encontrar etiquetas sem processos</strong></p>\n<ul>\n<li>Acesse a p\u00e1gina de cria\u00e7\u00e3o de etiquetas.</li>\n<li>Ao lado do \u00edcone &quot;Fazer Magia&quot;, aparecer\u00e1 outro \u00edcone com o t\u00edtulo <strong>Gerenciador de Etiquetas</strong>. Clique neste \u00edcone.</li>\n<li>No lado direito da tela, aparecer\u00e1 um bot\u00e3o com o nome <strong>Localizar etiquetas sem processos</strong>. Clique nele e aguarde enquanto todas as etiquetas vazias s\u00e3o encontradas.</li>\n<li>Depois de localizar as etiquetas, voc\u00ea poder\u00e1 exclu\u00ed-las, se desejar.</li>\n</ul>\n</li>\n<li><p><strong>Localizar etiquetas parecidas</strong></p>\n<ul>\n<li>Clique no bot\u00e3o <strong>Localizar etiquetas parecidas</strong>.</li>\n<li>Aparecer\u00e1 uma lista de etiquetas com nomes parecidos, com o n\u00famero de processos na frente do nome.</li>\n<li>Se a etiqueta n\u00e3o estiver vazia, aparecer\u00e1 um \u00edcone verde. Clique nele para transferir todos os processos para a etiqueta com o maior n\u00famero. As outras etiquetas ser\u00e3o deletadas da lota\u00e7\u00e3o.</li>\n</ul>\n</li>\n<li><p><strong>Baixar processos com etiquetas pesquisadas</strong></p>\n<ul>\n<li>Pesquise pelo nome de uma etiqueta.</li>\n<li>Clique no nome correspondente. Isso mostrar\u00e1 todos os processos que cont\u00eam a etiqueta pesquisada.</li>\n<li>Logo acima dos n\u00fameros de processo, voc\u00ea encontrar\u00e1 um \u00edcone com uma seta para baixo. Clique neste \u00edcone para baixar um arquivo CSV com os processos para o seu computador.</li>\n</ul>\n</li>\n</ol>\n',
  "gestor-de-modelos": '<h1 id="funcionalidade-gestor-de-modelos">Funcionalidade: Gestor De Modelos</h1>\n<p>Descri\u00e7\u00e3o da funcionalidade: Gestor de modelos para o PJE, em vers\u00e3o experimental e em desenvolvimento, com possibilidade de utiliza\u00e7\u00e3o de trechos de modelo, chamando-os diretamente do Editor CKE pelos seus respectivos atalhos, com a possibilidade de configura\u00e7\u00e3o de vari\u00e1veis de entrada livremente elaboradas, que perguntam ao usu\u00e1rio do modelo quais os dados a serem preenchidos, bem como toolbar para facilitar elabora\u00e7\u00e3o de minutas, com possibilidade de copiar direto do word, ou juntar par\u00e1grafos para textos copiados de PDF.</p>\n<p>Configura\u00e7\u00f5es: chave tipo switch localizada na guia Recursos experimentais da p\u00e1gina de op\u00e7\u00f5es.</p>\n<p>Como testar:\nI - Cadastrar nova fonte de modelo:</p>\n<ol>\n<li>Ir para a p\u00e1gina de modelos do PJE</li>\n<li>Navegar para formul\u00e1rio</li>\n<li>Escolher tipo de modelo e de peti\u00e7\u00e3o.\nObs.: Pode ser escolhido qualquer tipo, em ambos os campos. Os tipos s\u00e3o irrelevantes para a utiliza\u00e7\u00e3o dos modelos, que podem ser chamados a partir de qualquer local que utilize o CKEditor4 (popularmente chamado de &quot;editor novo&quot;).</li>\n<li>Escolher editor CKEditor</li>\n<li>Clicar em &quot;CRIAR FONTE DE MODELOS&quot;\nO documento e nome de modelo ser\u00e3o automaticamente preenchidos.</li>\n<li>Clicar em &quot;INCLUIR MODELO&quot;</li>\n<li>Preencher os campos &quot;T\u00edtulo do modelo&quot;, &quot;Atalho de chamada&quot;, &quot;Vari\u00e1veis de entrada&quot;(opcional) e inserir o modelo no editor.\nA inser\u00e7\u00e3o de vari\u00e1veis de entrada \u00e9 opcional, por\u00e9m, todos os campos s\u00e3o obrigat\u00f3rios, CASO o usu\u00e1rio queira inserir uma vari\u00e1vel de entrada.\nAs entradas podem ser de tipo texto, ou tipo opcional.\nEntrada de tipo texto consiste em um campo de texto a ser preenchido quando o modelo for utilizado.\nEx.: Marca de ve\u00edculo, endere\u00e7o do im\u00f3vel, n\u00famero de contrato, n\u00famero de protocolo de benef\u00edcio do INSS, etc.\nEntrada de tipo opcional consiste em um campo de checkbox a ser selecionado, ou n\u00e3o, pelo usu\u00e1rio do modelo. Caso seja marcado, o texto respectivo ser\u00e1 inserido.\nEx.: Emendar a peti\u00e7\u00e3o para (a, b, c, d, e...?), ou incluir partes separadas de modelo em caso de a\u00e7\u00f5es sobre a incid\u00eancia de contribui\u00e7\u00f5es sociais sobre verbas (a, b, c, d, e...)</li>\n<li>Ap\u00f3s a edi\u00e7\u00e3o, clicar em &quot;ENVIAR&quot;, e o modelo ser\u00e1 inserido na lista de modelos.</li>\n<li>Clicar no \u00edcone de salvar (disquete), para salvar o modelo no PJE.</li>\n</ol>\n<p>II - Utilizando a fonte de modelo:</p>\n<ol>\n<li>Ap\u00f3s a inser\u00e7\u00e3o da fonte, navegar para a p\u00e1gina de modelos do PJE, &quot;Pesquisa&quot;, e pesquisar os modelos do CKEditor.\nA fonte inserida pelo gestor ter\u00e1 o padr\u00e3o &quot;pjemr-modelos-id_XXXXXXXX.XXXXXXXXXXX_XXXXXXXXXXX&quot;, e poder\u00e1 ser escolhida como fonte.</li>\n<li>Clicar em &quot;DEFINIR COMO FONTE DE MODELOS&quot;</li>\n</ol>\n<p>Pronto! Os modelos inseridos na fonte j\u00e1 podem ser utilizados nas p\u00e1ginas de tarefa que utilizam o CKEditor, seja pelo atalho, seja pelo \u00edcone de busca do gestor.</p>\n<p>III - Toolbar - Ferramentas de ajuda</p>\n<ol>\n<li>O toolbar dever\u00e1 aparecer nas p\u00e1ginas de minuta que utilizem o CKEditor, com as seguintes ferramentas:\na) Copiar do word: Abre uma tela com o CKEditor5, para colagem de textos do word, que podem ser transpostos para o CKEditor4, mantendo a formata\u00e7\u00e3o original.\nb) Buscar modelos: Para busca e inser\u00e7\u00e3o de modelos da Fonte de Modelos do gestor, j\u00e1 cadastrada pelo usu\u00e1rio, com preview - sem formata\u00e7\u00e3o - ao passar o mouse por cima do t\u00edtulo, e filtro por nome. O modelo pode ser inserido ao clicar no t\u00edtulo do modelo (neste caso, ele \u00e9 inserido no final do texto).\nc) Juntar par\u00e1grafos: &quot;Elimina&quot; ou &quot;junta&quot; os par\u00e1grafos criados ao copiar textos de PDF. O usu\u00e1rio deve selecionar o texto, e clicar no bot\u00e3o.\nObs.: A funcionalidade elimina os espa\u00e7os duplos ao ser acionada novamente, caso seja necess\u00e1rio.</li>\n</ol>\n',
  "infojud": '<h1 id="funcionalidade-infojud">Funcionalidade: Infojud</h1>\n<h2 id="descri\u00e7\u00e3o-da-funcionalidade">Descri\u00e7\u00e3o da funcionalidade</h2>\n<p>Preenche automaticamente os campos do Infojud, conforme dados anteriormente capturados dos autos.</p>\n<h2 id="configura\u00e7\u00f5es">Configura\u00e7\u00f5es</h2>\n<p>A funcionalidade pode ser ativada atrav\u00e9s de uma chave tipo switch localizada na guia <strong>Automa\u00e7\u00e3o</strong> da p\u00e1gina de op\u00e7\u00f5es.</p>\n<h2 id="como-testar">Como testar</h2>\n<ol>\n<li>Na p\u00e1gina dos Autos Digitais, aparecer\u00e1 um \u00edcone de &quot;I&quot;.</li>\n<li>Clique no \u00edcone para abrir uma janela de apoio j\u00e1 preenchida com os dados de autua\u00e7\u00e3o e a sele\u00e7\u00e3o de todas as partes do polo passivo como destinat\u00e1rios da ordem.</li>\n<li>Se necess\u00e1rio, fa\u00e7a as altera\u00e7\u00f5es nas sele\u00e7\u00f5es.</li>\n<li>Preencha o nome da Vara/Ju\u00edzo e a quantidade de anos (deve ser um n\u00famero inteiro) apenas uma vez.</li>\n<li>Para as demais ordens, os dados ser\u00e3o gravados no PJE+R. O nome da Vara deve ser o mesmo que consta no Infojud.</li>\n<li>Ap\u00f3s preencher os dados, clique em <strong>Capturar</strong>.</li>\n</ol>\n<h2 id="infojud">Infojud</h2>\n<p>Na p\u00e1gina de inser\u00e7\u00e3o do Infojud, dever\u00e1 aparecer um bot\u00e3o chamado <strong>Preencher automaticamente</strong>, que transferir\u00e1 os dados capturados para a tela de cadastro de formul\u00e1rio.</p>\n',
  "intima-zap": '<h1 id="funcionalidade-intima-zap">Funcionalidade: Intima Zap</h1>\n<h2 id="descri\u00e7\u00e3o-da-funcionalidade">Descri\u00e7\u00e3o da Funcionalidade</h2>\n<p>A funcionalidade Intima Zap permite enviar intima\u00e7\u00f5es via WhatsApp para os Autores das a\u00e7\u00f5es judiciais.</p>\n<h2 id="configura\u00e7\u00f5es">Configura\u00e7\u00f5es</h2>\n<ul>\n<li><strong>Localiza\u00e7\u00e3o:</strong> A chave de tipo switch est\u00e1 localizada na guia &quot;Recursos experimentais&quot; da p\u00e1gina de op\u00e7\u00f5es.</li>\n<li><strong>Nome da Chave:</strong> Intima Zap</li>\n</ul>\n<h2 id="como-testar">Como Testar</h2>\n<ol>\n<li><p><strong>Ativar a Funcionalidade:</strong></p>\n<ul>\n<li>Ative a funcionalidade na guia &quot;Recursos experimentais&quot;.</li>\n</ul>\n</li>\n<li><p><strong>Acessar Autos Digitais:</strong></p>\n<ul>\n<li>Entre na se\u00e7\u00e3o de Autos Digitais.</li>\n</ul>\n</li>\n<li><p><strong>Identificar o Menu Hamb\u00farguer:</strong></p>\n<ul>\n<li>Pr\u00f3ximo ao n\u00famero do processo, aparecer\u00e1 um menu hamb\u00farguer laranja. Clique nele.</li>\n</ul>\n</li>\n<li><p><strong>Acessar o Bot\u00e3o de WhatsApp:</strong></p>\n<ul>\n<li>No menu, aparecer\u00e1 um bot\u00e3o com o \u00edcone do WhatsApp. Clique nele.</li>\n</ul>\n</li>\n<li><p><strong>Preencher o Modal:</strong></p>\n<ul>\n<li>Insira o telefone do destinat\u00e1rio (autor, r\u00e9u, perito, etc.) com o DDD.</li>\n<li>Coloque um assunto padr\u00e3o.</li>\n<li>Selecione os documentos que deseja enviar marcando os checkboxes na lista.</li>\n</ul>\n</li>\n<li><p><strong>Enviar a Intima\u00e7\u00e3o:</strong></p>\n<ul>\n<li>Clique no bot\u00e3o &quot;Enviar Intima\u00e7\u00e3o&quot;.</li>\n</ul>\n</li>\n<li><p><strong>Visualizar Documentos:</strong></p>\n<ul>\n<li>Caso queira ler os documentos antes de envi\u00e1-los, clique sobre o nome do documento para abrir um link separadamente.</li>\n</ul>\n</li>\n</ol>\n<h2 id="observa\u00e7\u00f5es">Observa\u00e7\u00f5es</h2>\n<ul>\n<li><strong>Limita\u00e7\u00f5es:</strong> No momento, a funcionalidade s\u00f3 envia documentos produzidos pelo pr\u00f3prio PJe, como Certid\u00f5es e Atos Ordinat\u00f3rios. Documentos em PDFs externos n\u00e3o s\u00e3o enviados.</li>\n</ul>\n<h2 id="exemplo-de-uso">Exemplo de Uso</h2>\n<p>Para ativar e utilizar a funcionalidade Intima Zap, siga os passos descritos na se\u00e7\u00e3o &quot;Como Testar&quot;. Essa funcionalidade \u00e9 \u00fatil para facilitar o envio de intima\u00e7\u00f5es diretamente via WhatsApp, economizando tempo e agilizando processos.</p>\n',
  "links-ultimas-tarefas": '<h1 id="funcionalidade-links-nas-\u00faltimas-tarefas">Funcionalidade: Links nas \u00daltimas Tarefas</h1>\n<h2 id="descri\u00e7\u00e3o-da-funcionalidade">Descri\u00e7\u00e3o da funcionalidade</h2>\n<p>Esta funcionalidade cria links para os n\u00fameros de processos e tarefas constantes na tela de <strong>\u00daltimas Tarefas</strong> no painel do usu\u00e1rio.</p>\n<h2 id="configura\u00e7\u00f5es">Configura\u00e7\u00f5es</h2>\n<p>A funcionalidade \u00e9 ativada automaticamente e n\u00e3o requer configura\u00e7\u00e3o manual.</p>\n<h2 id="como-testar">Como testar</h2>\n<ol>\n<li>Acesse a tela de <strong>\u00daltimas Tarefas</strong> no painel do usu\u00e1rio.</li>\n<li>Clique no n\u00famero, nome da tarefa ou \u00edcone correspondente.</li>\n<li>Uma pop-up ser\u00e1 aberta para o processo ou tarefa selecionado.</li>\n</ol>\n',
  "mais-atalhos-autos-digitais": '<h1 id="funcionalidade-mais-atalhos-nos-autos-didgitais">Funcionalidade: Mais atalhos nos autos didgitais</h1>\n<h2 id="descri\u00e7\u00e3o-da-funcionalidade">Descri\u00e7\u00e3o da funcionalidade</h2>\n<p>Cria mais atalhos na barra de navega\u00e7\u00e3o dos autos digitais.</p>\n<ol>\n<li>Atalho para exibir tarefas do processo</li>\n<li>Atalho para editar objeto do processo</li>\n</ol>\n<h2 id="configura\u00e7\u00e3o">Configura\u00e7\u00e3o</h2>\n<p>chave tipo switch localizada na guia Recursos experimentais da p\u00e1gina de op\u00e7\u00f5es.</p>\n<h2 id="como-testar">Como testar</h2>\n<p>Abrir os autos digitais e na barra superior clicar nos \u00edcones que foram adicionados.</p>\n',
  "mapa-de-calor-painel-usuario": '<h1 id="funcionalidade-mapa-de-calor-painel-usuario">Funcionalidade: Mapa De Calor Painel Usuario</h1>\n<p>#Descri\u00e7\u00e3o da funcionalidade\nMonta um mapa de calor do painel do usu\u00e1rio a fim de obter uma perpectiva da situa\u00e7\u00e3o da paralisa\u00e7\u00e3o do acervo da unidade judicial. O mapa suporta a exibi\u00e7\u00e3o de quatros n\u00edveis de cores para a exibi\u00e7\u00e3o da severidade da paralisa\u00e7\u00e3o</p>\n<p>#Configura\u00e7\u00f5es\n##Ativar Mapa de Calor no Painel do Usu\u00e1rio\nUma chave tipo switch localizada na guia Mapa de Calor Painel Usu\u00e1roi da p\u00e1gina de op\u00e7\u00f5es ativa e desativa a funcionalidade. A demais configura\u00e7\u00f5es s\u00e3o acess\u00f3rias, dependendo desta configura\u00e7\u00e3o.</p>\n<p>##Mapa de Calor baseado nos dados\nA configura\u00e7\u00e3o Mapa de Calor baseado nos dados dever\u00e1 ser definido a fonte dos dados para an\u00e1lise.</p>\n<ol>\n<li><strong>Quantidade pendente em rela\u00e7\u00e3o ao acervo total</strong>: utilize para ter uma perspectiva de quais s\u00e3o as tarefa que possuem mais carga de processo para execu\u00e7\u00e3o.</li>\n<li><strong>Quantidade pendente com contagem de decurso de dias baseado na data de entrada da tarefa</strong>: a fim de verificar processos paralisados no acervo, quantidade de dias parado, baseado na data da entrada do processo na tarefa relacionada.</li>\n<li><strong>Quantidade pendente com contagem de decurso de dias baseado na data do \u00faltimo movimento do processo</strong>, a fim de verificar processos paralisados no acervo, quantidade de dias parado, baseado na data do \u00faltimo movimento do processo. <strong>Este crit\u00e9rio de an\u00e1lise n\u00e3o est\u00e1 dispon\u00edvel para todos os tribunais</strong>.</li>\n</ol>\n<p>##Definir limites para dias decorridos\nA fim de estabelecer os limites da paraliza\u00e7\u00e3o do acervo, poder\u00e3o ser aproveitadas as mesmas configura\u00e7\u00f5es dos n\u00edveus encontrados na funcionalidade <strong>Melhorar Cart\u00e3o da Tarefa</strong>, ativando-se a chave pr\u00f3pria.\nAlternativamente, novos n\u00edveis de limites para esta funcionalidade podem ser definidos pelo us\u00e1rio em seus n\u00edveis vermelho, amarelo e verde.</p>\n<p>##Formato da barra de calor\nBot\u00f5es de op\u00e7\u00f5es para definir o formatdo da barra de calor quando a origem dos dados est\u00e1 baseado em &#39;Quantidade pendente com contagem de decurso de dias baseado na data de entrada da tarefa&#39; ou &#39;Quantidade pendente com contagem de decurso de dias baseado na data do \u00faltimo movimento do processo&#39;.\nPara a origem &#39;Quantidade pendente em rela\u00e7\u00e3o ao acervo total&#39; ser\u00e1 utilizado um formato padr\u00e3o n\u00e3o configur\u00e1vel.</p>\n<p>##Ignorar as tarefas abaixo\nPara evitar o processamento de tarefas que n\u00e3o causam impacto para a paralisa\u00e7\u00e3o do acervo estabelecido pela corregedoria do tribunal, uma lista de tarefas poder\u00e1 ser informada nesta funcionalidade.</p>\n<p>#Outras informa\u00e7\u00f5es\nUma vez montado o mapa, a carga de dados recebidos do tribunal estar\u00e3o <strong>armazenadas na mem\u00f3ria da extens\u00e3o pelo prazo de 24 horas</strong> a fim de evitar muitas chamadas aos servidores do PJe do tribunal.</p>\n<p>#Exibi\u00e7\u00e3o</p>\n<p><img src="/src/content/mapa-de-calor-painel-usuario/mapa_calor.PNG" alt="Mapa de calor ativo"></p>\n',
  "minuta-remove-orientacoes": '<h1 id="funcionalidade-remover-orienta\u00e7\u00f5es-da-minuta">Funcionalidade: Remover Orienta\u00e7\u00f5es da Minuta</h1>\n<h2 id="descri\u00e7\u00e3o">Descri\u00e7\u00e3o</h2>\n<p>Esta funcionalidade tem como objetivo remover o aviso <strong>&quot;ATEN\u00c7\u00c3O: ORIENTA\u00c7\u00d5ES IMPORTANTES&quot;</strong> que aparece na p\u00e1gina de minuta.</p>\n<h2 id="configura\u00e7\u00f5es">Configura\u00e7\u00f5es</h2>\n<p>A funcionalidade pode ser ativada atrav\u00e9s de uma chave do tipo <em>switch</em>, localizada na guia <strong>Recursos Experimentais</strong> da p\u00e1gina de op\u00e7\u00f5es. Para ativ\u00e1-la, basta selecionar a op\u00e7\u00e3o <strong>Minuta Remove Orienta\u00e7\u00f5es</strong>.</p>\n<h2 id="como-testar">Como Testar</h2>\n<p>Ap\u00f3s ativar a chave <strong>Minuta Remove Orienta\u00e7\u00f5es</strong>, ao acessar uma tarefa de minutar, o aviso <strong>&quot;ATEN\u00c7\u00c3O: ORIENTA\u00c7\u00d5ES IMPORTANTES&quot;</strong> n\u00e3o ser\u00e1 mais exibido, assim como as explica\u00e7\u00f5es relacionadas.</p>\n<h2 id="objetivo">Objetivo</h2>\n<p>O principal objetivo dessa funcionalidade \u00e9 tornar a p\u00e1gina de minuta mais leg\u00edvel e visualmente agrad\u00e1vel. Quando o usu\u00e1rio j\u00e1 est\u00e1 habituado a minutar, n\u00e3o \u00e9 necess\u00e1rio consultar as orienta\u00e7\u00f5es constantemente, o que melhora a experi\u00eancia de uso.</p>\n',
  "mostra-processos-digitos": '<h1 id="funcionalidade-mostrar-ou-colorir-processos-por-d\u00edgitos">Funcionalidade: Mostrar ou colorir processos por d\u00edgitos</h1>\n<h2 id="descri\u00e7\u00e3o-da-funcionalidade">Descri\u00e7\u00e3o da funcionalidade</h2>\n<p>A funcionalidade &quot;Mostra Processos D\u00edgitos&quot; permite aos usu\u00e1rios destacar n\u00fameros de processos com uma cor selecionada pelo pr\u00f3prio usu\u00e1rio, bem como a op\u00e7\u00e3o de ocultar processos com base em d\u00edgitos espec\u00edficos.</p>\n<h3 id="configura\u00e7\u00f5es">Configura\u00e7\u00f5es</h3>\n<ul>\n<li><strong>Chave tipo switch</strong>: Localizada na guia Recursos experimentais da p\u00e1gina de op\u00e7\u00f5es.</li>\n</ul>\n<h2 id="como-testar">Como testar</h2>\n<h3 id="passo-a-passo">Passo a Passo</h3>\n<ol>\n<li><p><strong>Acesse uma tarefa</strong></p>\n<ul>\n<li>Clique no \u00edcone &quot;Filtro que esta na cor laranja&quot; lodo depois o icone Selecionar todos.</li>\n</ul>\n</li>\n<li><p><strong>Configura\u00e7\u00e3o da funcionalidade</strong></p>\n</li>\n</ol>\n<p>O usu\u00e1rio tem a possibilidade de escolher uma sequ\u00eancia de 0 a 99 para selecionar os processos..</p>\n<p>Al\u00e9m disso, h\u00e1 a op\u00e7\u00e3o de escolher se o n\u00famero selecionado aparecer\u00e1 antes ou depois do d\u00edgito (-).</p>\n<ul>\n<li>Voc\u00ea ver\u00e1 o t\u00edtulo &quot;Selecione os d\u00edgitos que deseja destacar&quot;.</li>\n<li>Selecione os d\u00edgitos que deseja destacar.</li>\n<li>Escolha a cor para destacar os processos.</li>\n</ul>\n<ol start="3">\n<li><p><strong>Destacar processos com a cor desejada</strong></p>\n<ul>\n<li>Os processos que cont\u00eam os d\u00edgitos selecionados ser\u00e3o destacados com a cor escolhida.</li>\n</ul>\n</li>\n<li><p><strong>Ocultar processos por d\u00edgitos</strong></p>\n<ul>\n<li>Abaixo dos checkboxes para sele\u00e7\u00e3o de d\u00edgitos, h\u00e1 duas op\u00e7\u00f5es de r\u00e1dio:<ul>\n<li><strong>Deseja Colorir os n\u00fameros dos processos</strong>: Selecionar esta op\u00e7\u00e3o permitir\u00e1 que voc\u00ea escolha uma cor para destacar os processos.</li>\n<li><strong>Visualizar apenas os processos que contenham os d\u00edgitos selecionados</strong>: Selecionar esta op\u00e7\u00e3o ocultar\u00e1 todos os processos que n\u00e3o contenham os d\u00edgitos selecionados.</li>\n</ul>\n</li>\n</ul>\n</li>\n<li><p><strong>A\u00e7\u00f5es adicionais</strong></p>\n<ul>\n<li><strong>Marcar Todos</strong>: Um bot\u00e3o para selecionar todos os d\u00edgitos de uma vez.</li>\n<li><strong>Desmarcar Todos</strong>: Um bot\u00e3o para desmarcar todos os d\u00edgitos.</li>\n</ul>\n</li>\n</ol>\n<h3 id="interface-do-usu\u00e1rio">Interface do usu\u00e1rio</h3>\n<ul>\n<li><strong>T\u00edtulo</strong>: &quot;Selecione os d\u00edgitos que deseja destacar&quot;.</li>\n<li><strong>Checkboxes</strong>: Para selecionar os d\u00edgitos (0-9) que deseja destacar.</li>\n<li><strong>Bot\u00f5es de a\u00e7\u00e3o</strong>: &quot;Marcar Todos&quot; e &quot;Desmarcar Todos&quot;.</li>\n<li><strong>Op\u00e7\u00f5es de R\u00e1dio</strong>: Para escolher entre destacar com cor ou ocultar processos.</li>\n<li><strong>Paleta de cores</strong>: Dispon\u00edvel somente quando a op\u00e7\u00e3o &quot;Deseja Colorir os n\u00fameros dos processos&quot; est\u00e1 selecionada.</li>\n</ul>\n<h2 id="resumo-das-funcionalidades">Resumo das funcionalidades</h2>\n<ol>\n<li><p><strong>Destacar Processos por cor</strong></p>\n<ul>\n<li>Selecione os d\u00edgitos.</li>\n<li>Escolha uma cor.</li>\n<li>Os processos com os d\u00edgitos selecionados ser\u00e3o destacados.</li>\n</ul>\n</li>\n<li><p><strong>Ocultar Processos</strong></p>\n<ul>\n<li>Selecione os d\u00edgitos.</li>\n<li>Escolha a op\u00e7\u00e3o &quot;Visualizar apenas os processos que contenham os d\u00edgitos selecionados&quot;.</li>\n<li>Os processos que n\u00e3o cont\u00eam os d\u00edgitos selecionados ser\u00e3o ocultados.</li>\n</ul>\n</li>\n</ol>\n<h3 id="dicas-para-melhor-utiliza\u00e7\u00e3o">Dicas para melhor utiliza\u00e7\u00e3o</h3>\n<ul>\n<li>Utilize a op\u00e7\u00e3o de &quot;Marcar Todos&quot; para rapidamente selecionar todos os d\u00edgitos se deseja visualizar todos os processos.</li>\n<li>Use a paleta de cores para escolher uma cor que contraste bem com o fundo, garantindo melhor visibilidade dos processos destacados.</li>\n</ul>\n',
  "mostrar-resultado-diligencia": '<h1 id="funcionalidade-mostrar-resultado-diligencia">Funcionalidade: Mostrar Resultado Diligencia</h1>\n<h2 id="descri\u00e7\u00e3o-da-funcionalidade">Descri\u00e7\u00e3o da funcionalidade</h2>\n<p>Ao ativar essa funcionalidade, o Oficial de Justi\u00e7a poder\u00e1 visualizar o resultado de dilig\u00eancia selecionado anteriormente na tela &quot;Registrar Resultado Dilig\u00eancia&quot;.</p>\n<h2 id="configura\u00e7\u00f5es">Configura\u00e7\u00f5es</h2>\n<p>chave tipo switch localizada na guia Recursos experimentais da p\u00e1gina de op\u00e7\u00f5es.</p>\n<h2 id="como-testar">Como testar</h2>\n<ul>\n<li>Clique no \u00edcone de registrar resultado de dilig\u00eancia</li>\n<li>Selecione o resultado de dilig\u00eancia e clique no bot\u00e3o continuar</li>\n<li>Visualize a op\u00e7\u00e3o ao lado do texto &quot;RESULTADO DA DILIG\u00caNCIA&quot;</li>\n</ul>\n',
  "multivisualizador": '<h1 id="funcionalidade-multivisualizador">Funcionalidade: Multivisualizador</h1>\n<h2 id="descri\u00e7\u00e3o-da-funcionalidade">Descri\u00e7\u00e3o da funcionalidade</h2>\n<p>Permite a visualiza\u00e7\u00e3o de mais de um documento pela aba de Autos Digitais.</p>\n<h2 id="configura\u00e7\u00f5es">Configura\u00e7\u00f5es</h2>\n<p>A funcionalidade pode ser ativada atrav\u00e9s de uma chave tipo switch localizada na guia <strong>Recursos experimentais</strong> da p\u00e1gina de op\u00e7\u00f5es.</p>\n<h2 id="como-testar">Como testar</h2>\n<ol>\n<li><p><strong>Abrindo Documentos:</strong></p>\n<ul>\n<li>Ao clicar nos documentos pela aba de Autos Digitais, eles ser\u00e3o abertos em novas abas e mantidos enquanto a aba estiver aberta.</li>\n<li>Documentos abertos ser\u00e3o sinalizados com fundo azul.</li>\n<li>Documentos abertos e posteriormente fechados ter\u00e3o fundo avermelhado.</li>\n<li>O documento atualmente selecionado ser\u00e1 destacado com uma borda preta.</li>\n</ul>\n</li>\n<li><p><strong>Intera\u00e7\u00e3o com Documentos:</strong></p>\n<ul>\n<li>Ao clicar no documento pela nova aba, o navegador ir\u00e1 focar no documento pelas abas de cronologia ou fases.</li>\n<li>V\u00eddeos ser\u00e3o abertos pelo navegador.</li>\n<li>Documentos que n\u00e3o podem ser abertos pelo navegador ser\u00e3o baixados automaticamente.</li>\n</ul>\n</li>\n<li><p><strong>Downloads de Documentos:</strong></p>\n<ul>\n<li>Caso o download n\u00e3o inicie sozinho, um link aparecer\u00e1 para o download manual.</li>\n<li>Em \u00faltimo caso, o download pode ser feito pelo \u00edcone de &quot;Download do documento&quot; do pr\u00f3prio PJE.</li>\n</ul>\n</li>\n</ol>\n',
  "painel-baixa-tarefas": '<h1 id="funcionalidade-bot\u00e3o-para-baixar-lista-de-processos-em-tarefa">Funcionalidade: Bot\u00e3o para Baixar Lista de Processos em Tarefa</h1>\n<h2 id="descri\u00e7\u00e3o-da-funcionalidade">Descri\u00e7\u00e3o da funcionalidade</h2>\n<p>Esta funcionalidade adiciona um bot\u00e3o ao lado de cada tarefa no painel do usu\u00e1rio, que ao ser clicado, baixa um arquivo CSV contendo dados dos processos contidos na tarefa.</p>\n<h2 id="configura\u00e7\u00f5es">Configura\u00e7\u00f5es</h2>\n<p>A funcionalidade pode ser ativada atrav\u00e9s de uma chave tipo switch localizada na guia <strong>Lista de Porocessos</strong> da p\u00e1gina de op\u00e7\u00f5es. L\u00e1 voc\u00ea poder\u00e1 optar por baixar um arquivo simplificado (com menos dados para facilitar a visualiza\u00e7\u00e3o) ou completa (com todos os dados que o PJE fornece em cada lista de processos).</p>\n<p>Agora \u00e9 poss\u00edvel baixar apenas a lista de processos filtrados pela funcionalidade <code>Filtro de Tarefas</code>. Quando algum filtro estiver ativo, o usu\u00e1rio ver\u00e1 uma janela na qual poder\u00e1 escolher entre baixar todos os processos ou apenas os processos das tarefas filtradas.</p>\n<h2 id="como-testar">Como testar</h2>\n<ol>\n<li>No painel do usu\u00e1rio, localize a guia de op\u00e7\u00f5es <strong>Lista de Porocessos</strong> ative o chave <strong>Painel baixar de tarefas</strong> e escolha qual tipo de planilha voc\u00ea deseja baixar. Por padr\u00e3o ela vir\u00e1 &quot;Simplificada&quot;. A partir de ent\u00e3o, voc\u00ea ver\u00e1 \u00edcones (bot\u00f5es) ao lado de cada tarefa.</li>\n<li>Clique no bot\u00e3o e um arquivo CSV ser\u00e1 baixado para a sua pasta de downloads padr\u00e3o.</li>\n<li>O arquivo ter\u00e1 o nome id\u00eantico ao da tarefa e conter\u00e1 os dados dos processos.</li>\n</ol>\n',
  "post-it": '<h1 id="funcionalidade-post-it">Funcionalidade: Post It</h1>\n<h2 id="descri\u00e7\u00e3o">Descri\u00e7\u00e3o</h2>\n<p>A funcionalidade <strong>Post It</strong> adiciona um atalho no painel superior direito dos autos digitais, permitindo a cria\u00e7\u00e3o de post-its virtuais que ficam vinculados ao processo em que foram criados. Os post-its s\u00e3o totalmente edit\u00e1veis, permitindo que os usu\u00e1rios adicionem t\u00edtulos e conte\u00fados personalizados para fazer anota\u00e7\u00f5es diretamente dentro do sistema, sem a necessidade de recorrer a programas externos. V\u00e1rios post-its podem ser criados dentro de um mesmo processo, facilitando a organiza\u00e7\u00e3o de notas e informa\u00e7\u00f5es.</p>\n<h2 id="funcionalidades-principais">Funcionalidades Principais</h2>\n<ul>\n<li><strong>Cria\u00e7\u00e3o de Post-its</strong>: Crie post-its personalizados diretamente nos autos digitais clicando no \u00edcone de atalho ou utilizando a combina\u00e7\u00e3o de teclas <code>Ctrl + Alt + P</code>.</li>\n<li><strong>Vincula\u00e7\u00e3o ao Processo</strong>: Os post-its s\u00e3o vinculados ao processo espec\u00edfico em que foram criados, aparecendo apenas quando o processo correspondente \u00e9 aberto.</li>\n<li><strong>Edi\u00e7\u00e3o de T\u00edtulos e Conte\u00fados</strong>: Tanto o t\u00edtulo quanto o conte\u00fado do post-it podem ser editados a qualquer momento, permitindo que o usu\u00e1rio ajuste suas anota\u00e7\u00f5es conforme necess\u00e1rio.</li>\n<li><strong>Persist\u00eancia Local</strong>: Os post-its s\u00e3o armazenados localmente no navegador do usu\u00e1rio, garantindo que as notas permane\u00e7am dispon\u00edveis mesmo ap\u00f3s a recarga da p\u00e1gina.</li>\n<li><strong>Configura\u00e7\u00e3o de Menu Contextual</strong>: Um menu contextual pode ser acessado clicando no \u00edcone de engrenagem no t\u00edtulo de um post-it ou clicando com o bot\u00e3o direito no \u00edcone de atalho de post-it no painel superior direito. Este menu oferece op\u00e7\u00f5es como copiar o conte\u00fado da nota, fechar a nota, importar notas e exportar notas.</li>\n<li><strong>Importa\u00e7\u00e3o/Exporta\u00e7\u00e3o de Notas</strong>: Para mitigar as limita\u00e7\u00f5es relacionadas ao armazenamento local, \u00e9 poss\u00edvel importar e exportar notas em formato JSON. Isso permite que o usu\u00e1rio transfira post-its entre diferentes dispositivos ou fa\u00e7a backup das suas anota\u00e7\u00f5es.</li>\n<li><strong>Arrastar e Redimensionar</strong>: Os post-its podem ser movidos pela p\u00e1gina ao arrastar o t\u00edtulo ou o \u00edcone de movimenta\u00e7\u00e3o localizado no canto inferior esquerdo. Eles tamb\u00e9m podem ser redimensionados, permitindo ao usu\u00e1rio ajustar o tamanho da nota conforme necess\u00e1rio.</li>\n</ul>\n<h2 id="limita\u00e7\u00f5es">Limita\u00e7\u00f5es</h2>\n<ul>\n<li><strong>Armazenamento Local</strong>: Atualmente, os post-its s\u00e3o armazenados localmente no navegador do usu\u00e1rio, o que significa que eles s\u00f3 aparecer\u00e3o no computador em que foram criados. Para mitigar essa limita\u00e7\u00e3o, o usu\u00e1rio pode utilizar a funcionalidade de importa\u00e7\u00e3o/exporta\u00e7\u00e3o de notas para transferir suas anota\u00e7\u00f5es entre diferentes dispositivos.</li>\n<li><strong>Compatibilidade de Navegadores</strong>: A funcionalidade foi testada principalmente em navegadores modernos. A compatibilidade com vers\u00f5es antigas de navegadores n\u00e3o foi verificada.</li>\n<li><strong>Quantidade de caracteres</strong>: Impusemos um limite de 30 caract\u00e9res para o t\u00edtulo e de 1.300 para o conte\u00fado da nota.</li>\n</ul>\n<h2 id="configura\u00e7\u00f5es">Configura\u00e7\u00f5es</h2>\n<p>Para ativar ou desativar a funcionalidade <strong>Post It</strong>, utilize a chave de configura\u00e7\u00e3o do tipo &quot;switch&quot; localizada na guia &quot;Recursos experimentais&quot; na p\u00e1gina de op\u00e7\u00f5es da extens\u00e3o.</p>\n<h2 id="como-testar">Como Testar</h2>\n<ol>\n<li><strong>Criar Post-its</strong>: Clique no \u00edcone de post-it no canto superior direito ou use <code>Ctrl + Alt + P</code>.</li>\n<li><strong>Editar Notas</strong>: Clique no t\u00edtulo ou no conte\u00fado do post-it para editar.</li>\n<li><strong>Salvar Notas</strong>: As notas s\u00e3o salvas automaticamente, mas o indicador &quot;...&quot; avisa se h\u00e1 mudan\u00e7as n\u00e3o salvas.</li>\n<li><strong>Mover e Redimensionar</strong>: Arraste o post-it pelo t\u00edtulo ou pelo \u00edcone no canto inferior esquerdo para mov\u00ea-lo.</li>\n<li><strong>Importar/Exportar Notas</strong>: Use o menu de op\u00e7\u00f5es (\u00edcone de engrenagem) para importar ou exportar suas notas.</li>\n</ol>\n',
  "reproduzir-videos": '<h1 id="funcionalidade-reproduzir-v\u00eddeos">Funcionalidade: Reproduzir V\u00eddeos</h1>\n<h2 id="descri\u00e7\u00e3o-da-funcionalidade">Descri\u00e7\u00e3o da Funcionalidade</h2>\n<p>A funcionalidade &quot;Reproduzir V\u00eddeos&quot; aprimora a interface de anexos de v\u00eddeos, destacando visualmente os links de v\u00eddeo com uma cor de fundo amarela e um \u00edcone de play vermelho. Quando o usu\u00e1rio clica no link, o v\u00eddeo \u00e9 aberto em uma nova aba e, simultaneamente, o arquivo \u00e9 baixado automaticamente.</p>\n<h2 id="configura\u00e7\u00f5es">Configura\u00e7\u00f5es</h2>\n<p>A funcionalidade pode ser ativada por meio de uma chave do tipo <strong>switch</strong>, localizada na guia <strong>Recursos experimentais</strong> da p\u00e1gina de op\u00e7\u00f5es.</p>\n<h2 id="como-testar">Como Testar</h2>\n<ol>\n<li>Certifique-se de que a funcionalidade est\u00e1 ativada na guia <strong>Recursos experimentais</strong>.</li>\n<li>Acesse uma p\u00e1gina que contenha v\u00eddeos anexados na se\u00e7\u00e3o <strong>Anexos</strong>.</li>\n<li>Verifique se os links de v\u00eddeos est\u00e3o destacados com um fundo amarelo e um \u00edcone de play vermelho ao lado do texto.</li>\n<li>Clique no link do v\u00eddeo e confirme que:<ul>\n<li>O v\u00eddeo abre em uma nova aba com um player interativo.</li>\n<li>O arquivo de v\u00eddeo \u00e9 baixado automaticamente.</li>\n</ul>\n</li>\n</ol>\n',
  "seletor-processos": '<h1 id="funcionalidade-seletor-processos">Funcionalidade: Seletor Processos</h1>\n<p><strong>Descri\u00e7\u00e3o da funcionalidade</strong> : Esta funcionalidade vai permitir selecionar v\u00e1rios processos em uma tarefa com base em algum crit\u00e9rio escolhido pelo usu\u00e1rio. Atualmente os crit\u00e9rios s\u00e3o &quot;\u00daltima movimenta\u00e7\u00e3o&quot;, &quot;Etiqueta&quot;, &quot;Dias Parados&quot;</p>\n<p><strong>Configura\u00e7\u00f5es</strong> : chave tipo switch localizada na guia Recursos experimentais da p\u00e1gina de op\u00e7\u00f5es.</p>\n<p><strong>Como testar</strong> : Na tela de tarefas clique no s\u00edmbolo de lupa, aguarde o carregamento dos dados e aparecer\u00e1 a lista de processos.\nA seguir selecione quais tipos de \u00faltimas movimenta\u00e7\u00f5es deseja efetuar a sele\u00e7\u00e3o e clique em selecionar.\nCaso opte por Etiqueta existe a op\u00e7\u00e3o adicional de selecionar processos que possuem todas as etiquetas escolhidas, que possuem algumas delas ou que tenha apenas uam das escolhidas.\nCaso opte por Dias Parados pode se escolher o crit\u00e9rio de data de chegada ou de \u00faltima movimenta\u00e7\u00e3o para fazer o filtro e escolher o prazo pelo n\u00famero de dias parados ou se est\u00e3o parados desde uma determinada data.</p>\n<hr>\n<p>Ap\u00f3s feita a sele\u00e7\u00e3o ser\u00e1 criada um aba adicional &quot;SELE\u00c7\u00c3O&quot; com os processos selecionados para uma visualiza\u00e7\u00e3o alternativa. Ao voltar para a aba de processos a mesma ser\u00e1 desfeita.</p>\n',
  "serasajud": '<h1 id="funcionalidade-serasajud">Funcionalidade: SerasaJud</h1>\n<h2 id="descri\u00e7\u00e3o-da-funcionalidade">Descri\u00e7\u00e3o da funcionalidade</h2>\n<p>Preenche automaticamente os campos do SerasaJud, conforme dados anteriormente capturados dos autos.</p>\n<h2 id="configura\u00e7\u00f5es">Configura\u00e7\u00f5es</h2>\n<p>A funcionalidade pode ser ativada atrav\u00e9s de uma chave tipo switch localizada na guia <strong>Automa\u00e7\u00e3o</strong> da p\u00e1gina de op\u00e7\u00f5es.</p>\n<h2 id="como-testar">Como testar</h2>\n<ol>\n<li>Na p\u00e1gina dos Autos Digitais, aparecer\u00e1 um \u00edcone de &quot;Hamb\u00farguer&quot;.</li>\n<li>Clique no \u00edcone para abrir uma janela de apoio j\u00e1 preenchida com os dados de autua\u00e7\u00e3o e a sele\u00e7\u00e3o de todas as partes do polo passivo como destinat\u00e1rios da ordem.</li>\n<li>Se necess\u00e1rio, fa\u00e7a as altera\u00e7\u00f5es nas sele\u00e7\u00f5es.</li>\n<li>Preencha o nome do Foro/Vara, Nome do Juiz, Tipo da A\u00e7\u00e3o apenas uma vez, conforme aparece no SerasaJud.</li>\n<li>Ap\u00f3s preencher os dados, clique em <strong>Capturar Dados</strong>.</li>\n</ol>\n<h2 id="serasajud">SerasaJud</h2>\n<p>Na p\u00e1gina de inser\u00e7\u00e3o do SerasaJud, dever\u00e1 aparecer um bot\u00e3o chamado <strong>Pje+R</strong>, que transferir\u00e1 os dados capturados para a tela de cadastro de formul\u00e1rio.</p>\n',
  "sisbajud": '<h1 id="funcionalidade-sisbajud">Funcionalidade: Sisbajud</h1>\n<h2 id="descri\u00e7\u00e3o-da-funcionalidade">Descri\u00e7\u00e3o da funcionalidade</h2>\n<p>Preenche automaticamente os campos do Sisbajud, conforme dados anteriormente capturados dos autos.</p>\n<h2 id="configura\u00e7\u00f5es">Configura\u00e7\u00f5es</h2>\n<p>A funcionalidade pode ser ativada atrav\u00e9s de uma chave tipo switch localizada na guia <strong>Automa\u00e7\u00e3o</strong> da p\u00e1gina de op\u00e7\u00f5es.</p>\n<h2 id="como-testar">Como testar</h2>\n<ol>\n<li>Na p\u00e1gina dos Autos Digitais, aparecer\u00e1 um \u00edcone de cifr\u00e3o.</li>\n<li>Clique no \u00edcone para abrir uma janela de apoio j\u00e1 preenchida com os dados de autua\u00e7\u00e3o, a sele\u00e7\u00e3o de uma das partes do polo ativo como exequente e todas as partes do polo passivo como destinat\u00e1rios da ordem.</li>\n<li>Se necess\u00e1rio, fa\u00e7a as altera\u00e7\u00f5es nas sele\u00e7\u00f5es.</li>\n<li>Preencha o nome do(a) Juiz(a) solicitante e o ID da Vara/Ju\u00edzo apenas uma vez. Para as demais ordens, os dados ficar\u00e3o gravados no PJE+R. O ID da Vara e o nome do Juiz devem ser os mesmos que constam no Sisbajud.</li>\n<li>Ap\u00f3s preencher os dados, clique em <strong>Capturar</strong>.</li>\n</ol>\n<h2 id="sisbajud">Sisbajud</h2>\n<p>Na p\u00e1gina de inser\u00e7\u00e3o de nova minuta do Sisbajud, dever\u00e1 aparecer um bot\u00e3o chamado <strong>Preencher dados automaticamente</strong>, que transferir\u00e1 os dados capturados para a tela de cadastro de minuta.</p>\n',
  "tags-autos-digitais": '<h1 id="funcionalidade-visualizar-etiquetas-e-lembretes-nos-autos-digitais">Funcionalidade: Visualizar Etiquetas e Lembretes nos Autos Digitais</h1>\n<h2 id="descri\u00e7\u00e3o-da-funcionalidade">Descri\u00e7\u00e3o da funcionalidade</h2>\n<p>Mostra as etiquetas do processo e os lembretes quando na janela dos Autos Digitais.</p>\n<h3 id="lembretes">Lembretes</h3>\n<ul>\n<li>O \u00edcone do lembrete aparece antes do \u00edcone dos Autos Digitais.</li>\n<li>Foi adicionado um \u00edcone de lembretes nos Autos Digitais para que o usu\u00e1rio possa visualizar os lembretes apenas parando o mouse sobre ele.</li>\n</ul>\n<h2 id="configura\u00e7\u00f5es">Configura\u00e7\u00f5es</h2>\n<p>A funcionalidade pode ser ativada atrav\u00e9s de uma chave tipo switch localizada na guia <strong>Etiquetas</strong> da p\u00e1gina de op\u00e7\u00f5es.</p>\n<h2 id="como-testar">Como testar</h2>\n<ol>\n<li>Abra um processo em modo <strong>Autos Digitais</strong>.</li>\n<li>Visualize as etiquetas do processo abaixo do item <strong>Mais Detalhes</strong>.</li>\n<li>Veja o \u00edcone dos lembretes.</li>\n</ol>\n',
  "tags-mandados": '<h1 id="funcionalidade-de-tags-mandados">Funcionalidade de Tags Mandados</h1>\n<p>Essa funcionalidade permite que os Oficiais de Justi\u00e7a e Oficiais de Justi\u00e7a Distribuidores adicionem tags aos mandados diretamente na p\u00e1gina do Painel do Oficial de Justi\u00e7a. As tags servem como lembretes visuais e podem ser tanto predefinidas quanto personalizadas. Cada tag deve ser associada a uma cor, e \u00e9 poss\u00edvel adicionar ou criar m\u00faltiplas tags de uma s\u00f3 vez. Al\u00e9m disso, o sistema oferece a op\u00e7\u00e3o de exportar e importar tags, facilitando o gerenciamento e a reutiliza\u00e7\u00e3o de tags entre diferentes mandados.</p>\n<h2 id="funcionalidades">Funcionalidades</h2>\n<ul>\n<li><strong>Adicionar Tags</strong>: O oficial pode adicionar tags a um mandado, escolhendo entre tags predefinidas ou criando tags personalizadas.</li>\n<li><strong>Visualizar Tags</strong>: As tags associadas a um mandado s\u00e3o exibidas ao lado do mandado.</li>\n<li><strong>Remover Tags</strong>: Tags podem ser removidas clicando no \u00edcone de exclus\u00e3o na pr\u00f3pria tag.</li>\n<li><strong>Exportar/Importar Tags</strong>: \u00c9 poss\u00edvel exportar todas as tags associadas aos mandados para um arquivo JSON, e importar tags a partir de um arquivo JSON.</li>\n</ul>\n<h2 id="cores-dispon\u00edveis">Cores Dispon\u00edveis</h2>\n<p>As cores predefinidas que podem ser associadas \u00e0s tags s\u00e3o:</p>\n<ul>\n<li>Azul</li>\n<li>Verde</li>\n<li>Laranja</li>\n<li>Vermelho</li>\n</ul>\n<h2 id="como-usar">Como Usar</h2>\n<h3 id="adicionar-uma-tag">Adicionar uma Tag</h3>\n<ol>\n<li>Clique no bot\u00e3o com o \u00edcone de etiqueta ao lado do mandado desejado.</li>\n<li>Escolha uma tag predefinida ou crie uma tag personalizada.<ul>\n<li>Para uma tag personalizada, insira o t\u00edtulo da tag e escolha uma cor.</li>\n<li>Para uma tag predefinida, selecione e escolha uma cor caso ela j\u00e1 n\u00e3o tenha uma cor atribu\u00edda.</li>\n</ul>\n</li>\n<li>Clique em Salvar.</li>\n<li>A tag ser\u00e1 exibida ao lado do mandado.</li>\n</ol>\n<h3 id="remover-uma-tag">Remover uma Tag</h3>\n<ol>\n<li>Passe o mouse sobre a tag que deseja remover.</li>\n<li>Clique no \u00edcone de <strong>exclus\u00e3o</strong> (\u274c).</li>\n<li>Confirme a exclus\u00e3o.</li>\n</ol>\n<h3 id="exportar-tags">Exportar Tags</h3>\n<ol>\n<li>Clique no bot\u00e3o com o \u00edcone de <strong>Exportar Tags</strong>.</li>\n<li>O sistema baixar\u00e1 um arquivo JSON com as tags associadas aos mandados.</li>\n</ol>\n<h3 id="importar-tags">Importar Tags</h3>\n<ol>\n<li>Clique no bot\u00e3o com o \u00edcone de <strong>Importar Tags</strong>.</li>\n<li>Selecione um arquivo JSON com tags exportadas anteriormente.</li>\n<li>O sistema importar\u00e1 as tags e as associar\u00e1 aos mandados.</li>\n</ol>\n',
  "ultimas-etiquetas-usadas": '<h1 id="funcionalidade-\u00faltimas-etiquetas-usadas-na-tarefa">Funcionalidade: \u00daltimas Etiquetas Usadas na Tarefa</h1>\n<h2 id="o-que-esta-funcionalidade-faz">O que esta funcionalidade faz?</h2>\n<p>Esta funcionalidade adiciona as \u00faltimas etiquetas usadas na tarefa espec\u00edfica, facilitando o acesso r\u00e1pido \u00e0s etiquetas mais frequentes.</p>\n<h2 id="como-ativar-a-funcionalidade">Como ativar a funcionalidade?</h2>\n<p>Para ativar ou desativar o recurso, abra a p\u00e1gina de op\u00e7\u00f5es da extens\u00e3o, localize a guia <strong>Etiquetas</strong> e clique no bot\u00e3o ao lado direito da op\u00e7\u00e3o <strong>\u00daltimas etiquetas usadas</strong>.</p>\n<h2 id="como-testar">Como testar?</h2>\n<ol>\n<li><p><strong>Vincular e Desvincular Etiquetas:</strong></p>\n<ul>\n<li>Ao clicar com o mouse sobre o nome das etiquetas, voc\u00ea vincula a etiqueta ao processo, criando uma lista das \u00faltimas etiquetas usadas.</li>\n<li>Se a etiqueta n\u00e3o existir no processo, ela ser\u00e1 <strong>vinculada</strong>; se j\u00e1 existir, ser\u00e1 <strong>desvinculada</strong>.</li>\n</ul>\n</li>\n<li><p><strong>Personaliza\u00e7\u00e3o por Tarefas:</strong></p>\n<ul>\n<li>As \u00faltimas etiquetas usadas s\u00e3o personalizadas por tarefas. Por exemplo, se voc\u00ea estiver na tarefa <strong>Minutar Ato Ordinat\u00f3rio</strong>, as etiquetas mais usadas nessa tarefa aparecer\u00e3o no topo.</li>\n</ul>\n</li>\n<li><p><strong>Adicionar Etiquetas com ENTER:</strong></p>\n<ul>\n<li>Se voc\u00ea tentar adicionar uma etiqueta pressionando a tecla ENTER no campo de digita\u00e7\u00e3o e a etiqueta j\u00e1 existir, ser\u00e1 emitido um aviso de confirma\u00e7\u00e3o.</li>\n</ul>\n</li>\n<li><p><strong>Teste R\u00e1pido:</strong></p>\n<ul>\n<li>Clique com o mouse sobre o nome das etiquetas para ver a lista das \u00faltimas etiquetas usadas.</li>\n<li>Use a tecla ENTER no campo de digita\u00e7\u00e3o para adicionar uma etiqueta e observe o aviso de confirma\u00e7\u00e3o se a etiqueta j\u00e1 existir.</li>\n</ul>\n</li>\n</ol>\n',
  "visualizador-lembretes": '<h1 id="funcionalidade-visualizador-de-lembretes">Funcionalidade: Visualizador de Lembretes</h1>\n<h2 id="descri\u00e7\u00e3o-da-funcionalidade">Descri\u00e7\u00e3o da funcionalidade</h2>\n<p>Ao passar o mouse sobre o \u00edcone de lembrete, o conte\u00fado do lembrete aparecer\u00e1 como um t\u00edtulo (tooltip).</p>\n<h2 id="configura\u00e7\u00f5es">Configura\u00e7\u00f5es</h2>\n<p>Para ativar ou desativar a funcionalidade, abra a p\u00e1gina de op\u00e7\u00f5es da extens\u00e3o, localize a aba <strong>Etiquetas</strong> e clique na checkbox em frente \u00e0 op\u00e7\u00e3o <strong>Visualizar Lembretes</strong>.</p>\n<h2 id="como-testar">Como testar</h2>\n<ol>\n<li>Crie um lembrete no processo.</li>\n<li>Passe o mouse sobre o \u00edcone de lembretes.</li>\n<li>O conte\u00fado do lembrete dever\u00e1 aparecer como um t\u00edtulo (tooltip).</li>\n</ol>\n',
  "visualizar-anexo-resultado-diligencia": '<h1 id="funcionalidade-visualizar-anexo-resultado-dilig\u00eancia">Funcionalidade: Visualizar Anexo Resultado Dilig\u00eancia</h1>\n<h3 id="descri\u00e7\u00e3o-da-funcionalidade">Descri\u00e7\u00e3o da funcionalidade</h3>\n<p>A funcionalidade <strong>Visualizar Anexo Resultado Dilig\u00eancia</strong> permite que o usu\u00e1rio visualize anexos diretamente no navegador, sem precisar baix\u00e1-los. Quando ativada, ela adiciona um bot\u00e3o de visualiza\u00e7\u00e3o ao lado dos links de anexos. O usu\u00e1rio pode clicar neste bot\u00e3o para abrir o anexo (como imagens ou PDFs) em uma nova aba, facilitando o acesso ao conte\u00fado sem interromper o fluxo de navega\u00e7\u00e3o.</p>\n<h3 id="configura\u00e7\u00f5es">Configura\u00e7\u00f5es</h3>\n<p>A funcionalidade pode ser ativada ou desativada atrav\u00e9s de uma chave do tipo &quot;switch&quot; localizada na guia de <strong>Recursos Experimentais</strong> na p\u00e1gina de op\u00e7\u00f5es. Quando ativada, o bot\u00e3o de visualiza\u00e7\u00e3o ser\u00e1 automaticamente adicionado aos links de anexo relevantes.</p>\n<h3 id="como-testar">Como testar</h3>\n<ol start="2">\n<li>Ative a funcionalidade <strong>Visualizar Anexo Resultado Dilig\u00eancia</strong> na se\u00e7\u00e3o <strong>Recursos Experimentais</strong>.</li>\n<li>Ap\u00f3s ativar, observe que um \u00edcone de visualiza\u00e7\u00e3o aparecer\u00e1 ao lado dos links de anexo na p\u00e1gina de Edi\u00e7\u00e3o de Resultado de Dilig\u00eancia.</li>\n<li>Clique no \u00edcone de visualiza\u00e7\u00e3o ao lado de um anexo:<ul>\n<li>O anexo ser\u00e1 aberto em uma nova aba para visualiza\u00e7\u00e3o.</li>\n<li>O arquivo n\u00e3o ser\u00e1 baixado automaticamente.</li>\n</ul>\n</li>\n<li>Para desativar a funcionalidade, volte \u00e0 se\u00e7\u00e3o de Recursos Experimentais e desligue a chave. Os \u00edcones de visualiza\u00e7\u00e3o ser\u00e3o removidos.</li>\n</ol>\n<h3 id="observa\u00e7\u00f5es">Observa\u00e7\u00f5es</h3>\n<ul>\n<li>A funcionalidade oferece uma experi\u00eancia pr\u00e1tica para quem deseja visualizar anexos sem interromper seu fluxo de trabalho.</li>\n<li>O comportamento de abrir os anexos em uma nova aba \u00e9 compat\u00edvel com arquivos de imagem (PNG, JPEG) e PDFs.</li>\n</ul>\n'
};
