const Readme$1 = "# Funcionalidade: Melhorar o cart\u00e3o de tarefas\n\n## Descri\u00e7\u00e3o da funcionalidade\n\nMelhora o cart\u00e3o da tarefas para trazer mais informa\u00e7\u00f5es \u00fateis e funcionalidades para gest\u00e3o das tarefas pelo usu\u00e1rio, bem como procurar melhorar os destaques de exibi\u00e7\u00e3o de prioridade processual, n\u00famero do processo e o cart\u00e3o de tarefa selecionado para execu\u00e7\u00e3o pelo usu\u00e1rio.\nTraz um comando para copiar o n\u00famero do processo judicial. O pequeno mapa de calor tem como objetivo destacar visualmente o n\u00edvel para paraliza\u00e7\u00e3o do processo e tarefa. A altera\u00e7\u00e3o na cor padr\u00e3o da etiqueta procura destacar visualmente e melhorar o contraste para sua legibilidade. Em caso de conclus\u00e3o, realiza a contagem dos dias decorridos desde a conclus\u00e3o do processo.\n\n## Configura\u00e7\u00e3o\n\nO mapa de calor com base na quantidade de dias decorridos da entrada na tarefa e do \u00faltimo movimento do processo podem ser configurados conforme a realidade da gest\u00e3o processual na unidade judici\u00e1ria em tr\u00eas n\u00edveis, verde, amarelo e vermelho.\n\nO recursos de Melhora o destaque da prioridade processual no cart\u00e3o, Comando para copiar o n\u00famero do processo, Melhora o destaque do cart\u00e3o selecionado na lista de tarefas, Aumenta o destaque do n\u00famero do processo, Recurso para recolher o cart\u00e3o da tarefa e Altera a cor da etiqueta padr\u00e3o do sistema podem ser ativados ou desativados pelo usu\u00e1rio.\n\n## Recursos\n\n1. Destaque de data do \u00faltimo movimento do processo abaixo data de entrada da tarefa. O cart\u00e3o da tarefa ser\u00e1 atualizado com a data do ultimo movimento conforme o cart\u00e3o surgir na tela.\n2. Contagem de dias decorridos\n   2.1 desde a entrada do processo na tarefa.\n   2.2 desde o \u00faltimo movimento do processo\n   2.3 da conclus\u00e3o do processo\n3. Complementa a informa\u00e7\u00e3o 'ULTMA MOVIMENTA\u00c7\u00c3O' do cart\u00e3o para adicionar a data do movimento\n4. Destaque em tr\u00eas cores se decorridos dias desde a entrada do processo na tarefa e desde o \u00faltimo movimento do processo\n5. Melhora o destaque da prioridade processual no cart\u00e3o\n6. Comando para copiar o n\u00famero do processo\n7. Melhora o destaque do cart\u00e3o selecionado na lista de tarefas\n8. Aumenta o destaque do n\u00famero do processo\n9. Recurso para recolher o cart\u00e3o da tarefa\n10. Altera a cor da etiqueta padr\u00e3o do sistema\n\n## Exibi\u00e7\u00e3o com recursos ativados\n\n![Altera\u00e7\u00f5es no cart\u00e3o](/src/content/melhorar-cartao-tarefa/cartao-melhrado.png)\n\n##### Exibi\u00e7\u00e3o com contagem data conclus\u00e3o:\n\n![Contagem dias conclus\u00e3o](/src/content/melhorar-cartao-tarefa/cartao-contagem-conclusao.png)\n";
const BoasPraticas = "# Controle de prazos\n\nMuitos usu\u00e1rios usam as configura\u00e7\u00f5es para efetura controle de prazo, assinalando o total de dias corridos m\u00e1ximo para o vencimento do prazo processual espec\u00edfico \u00e0s suas necessidades de controle. Por exemplo: para um prazo de 15 dias \u00fateis, assinalar a o n\u00edvel amarelo partir de de 22, considerando n\u00e3o haver datas de suspens\u00e3o de prazo nesse per\u00edodo.\n\n# Situa\u00e7\u00e3o geral das tarefas a executar\n\nRolar at\u00e9 o final da p\u00e1gina dar\u00e1 ao usu\u00e1rio todos os n\u00edveis para cada tarefa, podendo executar imediatamente tarefas com n\u00edvel vermelho, em especial em rela\u00e7\u00e3o ao \u00faltimo movimento do processo.\n";
