const Readme = '# Funcionalidade: Painel Gerencial\n\n## Descri\u00e7\u00e3o da funcionalidade\n\nO Painel Gerencial \u00e9 uma ferramenta avan\u00e7ada que fornece uma interface completa para visualiza\u00e7\u00e3o, an\u00e1lise e gerenciamento de processos judiciais diretamente no sistema PJe. Esta funcionalidade permite ao usu\u00e1rio ter uma vis\u00e3o estat\u00edstica e detalhada dos processos sob sua responsabilidade, facilitando o acompanhamento e a gest\u00e3o processual.\n\n## Recursos principais\n\n1. **Resumo Estat\u00edstico**: Cards com m\u00e9tricas-chave sobre os processos (total de processos, processos com mais de 100 dias, tempo m\u00e9dio, processos priorit\u00e1rios, sigilosos e com mais de seis meses).\n2. **Tabela de Processos Avan\u00e7ada**: Visualiza\u00e7\u00e3o em forma de planilha com m\u00faltiplas funcionalidades como:\n   - Ordena\u00e7\u00e3o por colunas\n   - Filtragem avan\u00e7ada\n   - Pagina\u00e7\u00e3o\n   - Redimensionamento de colunas\n   - Expans\u00e3o de detalhes\n3. **Visualiza\u00e7\u00f5es Gr\u00e1ficas**: Gr\u00e1ficos interativos para an\u00e1lise de dados processuais.\n\n4. **Exporta\u00e7\u00e3o de Dados**: Capacidade de exportar informa\u00e7\u00f5es para formato CSV.\n\n5. **Filtros Avan\u00e7ados**: Sistema de filtragem complexo com salvamento de configura\u00e7\u00f5es.\n\n6. **Personaliza\u00e7\u00e3o**: Suas configura\u00e7\u00f5es de exibi\u00e7\u00e3o e comportamento s\u00e3o salvas automaticamente.\n\n## Configura\u00e7\u00e3o\n\nA funcionalidade \u00e9 ativada atrav\u00e9s de uma chave tipo switch localizada na guia Recursos experimentais da p\u00e1gina de op\u00e7\u00f5es da extens\u00e3o.\n\n## Como utilizar\n\n1. **Acessar o Painel**: Ap\u00f3s ativar a funcionalidade nas op\u00e7\u00f5es, acesse a p\u00e1gina principal do PJe. A abertura do Painel Gerencial ser\u00e1 pelo bot\u00e3o (logo) do PJe+R que fica na barra lateral esquerda da p\u00e1gina do painel de usu\u00e1rio do PJE. Se estiver ativiada, aparecer\u00e1 como um submenu do bot\u00e3o.\n\n2. **Visualizar Estat\u00edsticas**: Na primeira aba do painel, voc\u00ea encontrar\u00e1 cards com m\u00e9tricas importantes sobre seus processos.\n\n3. **Consultar Processos na Tabela**:\n\n   - Utilize a segunda aba para visualizar todos os processos em formato de tabela\n   - Ordene clicando nos cabe\u00e7alhos das colunas\n   - Filtre os processos usando o sistema de filtros avan\u00e7ados\n   - Exporte os dados para an\u00e1lise externa quando necess\u00e1rio (as planilhas ser\u00e3o exportadas com os filtros aplicados)\n\n4. **Analisar Gr\u00e1ficos**: Use a terceira aba para visualizar gr\u00e1ficos interativos que mostram distribui\u00e7\u00e3o de processos por classe, tempo em aberto, e outras m\u00e9tricas relevantes.\n\n5. **Personalizar Visualiza\u00e7\u00e3o**:\n\n   - Redimensione colunas da tabela conforme sua prefer\u00eancia\n   - Salve configura\u00e7\u00f5es de filtros frequentemente utilizados\n   - Ajuste o n\u00famero de itens por p\u00e1gina\n\n6. **Integra\u00e7\u00e3o com os Post-its**:\n   - Agora voc\u00ea poder\u00e1 visualizar os seus post-its diretamente no painel gerencial\n   - basta clicar no bot\u00e3o de atualizar e todos os post-its criados nos processos passar\u00e3o a ser exibidos em uma tabela ou cards na aba dos post-its. Configure como voc\u00ea achar melhor.\n\n## Como testar\n\n1. Ative a funcionalidade na p\u00e1gina de op\u00e7\u00f5es da extens\u00e3o, na guia "Recursos experimentais".\n2. Acesse a p\u00e1gina principal do PJe.\n3. Localize e clique no bot\u00e3o do Painel Gerencial adicionado ao logo do PJe+R que fica na barra lateral esquerda da p\u00e1gina do painel de usu\u00e1rio do PJE\n4. Verifique se o painel \u00e9 aberto e carrega corretamente os dados dos processos.\n5. Teste as diferentes abas (Resumo, Tabela, Gr\u00e1ficos) para verificar se todas as funcionalidades est\u00e3o operando corretamente.\n6. Tente exportar dados da tabela para CSV para confirmar que a exporta\u00e7\u00e3o funciona.\n7. Aplique diferentes filtros e ordena\u00e7\u00f5es na tabela para testar a manipula\u00e7\u00e3o de dados.\n';
