const ExperimentalDisclaimer = "# \ud83d\udce2 Orienta\u00e7\u00f5es sobre o Uso de Recurso Experimental\n\n## \ud83d\ude80 Introdu\u00e7\u00e3o\n\nEste documento fornece diretrizes detalhadas para o uso de um recurso experimental que foi recentemente adicionado ao sistema PJe. \u00c9 importante seguir estas orienta\u00e7\u00f5es para garantir uma experi\u00eancia de usu\u00e1rio mais tranquila e para ajudar na identifica\u00e7\u00e3o e resolu\u00e7\u00e3o de problemas de forma eficiente.\n\n## \u26a0\ufe0f Importante: Uso de Recurso Experimental\n\nO recurso em quest\u00e3o \u00e9 experimental e, portanto, pode apresentar comportamentos inesperados ou instabilidades. Isso \u00e9 normal durante a fase de teste e desenvolvimento. Aqui est\u00e3o alguns pontos a serem considerados:\n\n- **Funcionalidade Experimental**: Este recurso est\u00e1 em fase de teste e pode n\u00e3o funcionar como esperado em todos os cen\u00e1rios.\n- **Instabilidade**: Pode haver erros ou comportamentos indesejados durante o uso.\n\n## \ud83d\udee0\ufe0f Procedimento para Relatar Erros\n\nSe voc\u00ea encontrar um erro ou comportamento inesperado ao usar o recurso experimental, siga estas etapas antes de relatar o problema:\n\n### 1. Desative a Extens\u00e3o\n\nPrimeiramente, desative a extens\u00e3o que est\u00e1 utilizando o recurso experimental. Isso pode ser feito atrav\u00e9s das configura\u00e7\u00f5es do seu navegador ou sistema, conforme o m\u00e9todo que voc\u00ea est\u00e1 usando para integrar o recurso ao PJe.\n\n### 2. Verifique a Persist\u00eancia do Erro\n\nAp\u00f3s desativar a extens\u00e3o, verifique se o erro persiste:\n\n- **Erro Persistente**: Se o problema continuar ocorrendo mesmo com a extens\u00e3o desativada, o erro pode estar relacionado diretamente ao sistema PJe e n\u00e3o ao recurso experimental.\n- **Erro Resolvido**: Se o erro desaparecer ap\u00f3s desativar a extens\u00e3o, \u00e9 prov\u00e1vel que o problema esteja associado \u00e0 funcionalidade experimental.\n\n### 3. Relate o Problema ao Setor de TI\n\nSe o erro persistir ap\u00f3s a desativa\u00e7\u00e3o da extens\u00e3o, siga as etapas para relatar o problema ao setor de TI do tribunal:\n\n- **Prepare uma Descri\u00e7\u00e3o Detalhada**: Inclua informa\u00e7\u00f5es como o tipo de erro, mensagens exibidas, e qualquer passo que possa ter causado o problema.\n- **Inclua Capturas de Tela**: Se poss\u00edvel, adicione capturas de tela que ilustrem o erro encontrado.\n- **Envie o Relat\u00f3rio**: Entre em contato com o setor de TI atrav\u00e9s dos canais estabelecidos para suporte e forne\u00e7a todas as informa\u00e7\u00f5es coletadas.\n\n## \ud83d\udcde Contato com o Suporte\n\nPara suporte adicional ou para relatar problemas relacionados ao recurso experimental, voc\u00ea pode entrar em contato com nossos canais oficiais de WhatasApp e Telegram.\n\n## \ud83d\ude4f Agradecemos a Compreens\u00e3o\n\nAgradecemos sua compreens\u00e3o e colabora\u00e7\u00e3o enquanto trabalhamos para aprimorar este recurso experimental. Seu feedback \u00e9 valioso para n\u00f3s e ajuda a garantir a melhor experi\u00eancia poss\u00edvel para todos os usu\u00e1rios.\n";
